INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (51801, 1992, 'Fluconazole', 'Long QT Syndrome', 'Some azole antifungals have been associated with prolongation of the QT interval on the ECG.  Rare cases of QT prolongation and torsade de pointes have been reported during postmarketing experience; such reports usually involved seriously ill patients with multiple confounding risk factors, such as structural heart disease, electrolyte abnormalities, and concomitant medications.  These drugs should be administered with caution to patients with potentially proarrhythmic conditions.  Concomitant use with other medications that have potential to increase the risk of cardiotoxicity should be avoided.', '2', '', 'DDInter', 0);
