INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (51886, 347, 'Fluconazole', 'Kidney Diseases', 'Fluconazole is primarily eliminated by the kidney.  Patients with renal impairment may be at greater risk for adverse effects from fluconazole due to decreased drug clearance.  Dosage adjustments are recommended for patients with moderate to severe renal impairment (CrCl <= 50 mL/min) receiving multiple doses of the drug.', '2', '', 'DDInter', 0);
